el text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).','DIR','2020-08-20 00:00:00'),(13,'http://stikesrshusada.ac.id/uploads/fasilitas/akper_husada_fasilitas_33.jpg','Laborarorium Keperawatan Komunitas','','DIR','2020-10-02 00:00:00'),(14,'http://stikesrshusada.ac.id/uploads/fasilitas/akper_husada_fasilitas_59.JPG','Laboratorium Keperawatan Jiwa','','DIR','2020-10-02 00:00:00'),(15,'http://stikesrshusada.ac.id/uploads/fasilitas/akper_husada_fasilitas_124.JPG','Laboratorium Kegawatdaruratan','','DIR','2020-10-02 00:00:00'),(16,'http://stikesrshusada.ac.id/uploads/fasilitas/akper_husada_fasilitas_73.JPG','Laboratorium Keperawatan Anak','','DIR','2020-10-02 00:00:00'),(17,'http://akperhusada.ac.id/uploads/files/about.jpg','Sejarah Singkat Sekolah Tinggi Ilmu RS Husada ','         <p style=\"text-align:justify\"><img alt=\"\" src=\"http://akperhusada.ac.id/uploads/files/about.jpg\" style=\"height:500px; width:800px\"><strong><span style=\"font-size:14px\">&nbsp;</span></strong></p>\n\n<p style=\"text-align:justify\"><strong><span style=\"font-size:14px\">Sekolah Tinggi Ilmu Kesehatan RS Husada merupakan institusi pendidikan yang telah berdiri dan menyelenggarakan</span></strong></p>\n\n<p style=\"text-align:justify\"><strong><span style=\"font-size:14px\">pendidikan keperawatan sejak tahun 1943, dibawah Perkumpulan Husada.</span></strong></p>\n\n<p style=\"text-align:justify\">1943 - 1949 : Sekolah Juru Rawat&nbsp;</p>\n\n<p style=\"text-align:justify\">1949 - 1979 : Sekolah Pengatur Rawat (SPR)</p>\n\n<p style=\"text-align:justify\">1979 - 1989 : Sekolah Perawat Kesehatan (SPK)</p>\n\n<p style=\"text-align:justify\">1989 - 2019 : Akademi Keperawatan (D3&nbsp;Keperawatan)</p>\n\n<p style=\"text-align:justify\">2019 - Sekarang : Sekolah Tinggi Ilmu Kesehatan (D3 Keperawatan &amp; S1 Administrasi Kesehatan)</p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\">Sekolah Tinggi Ilmu Kesehatan Husada telah meluluskan 1939&nbsp;perawat dengan gelar AMd. Kep (Ahli Madya Keperawatan)</p>\n\n<p style=\"text-align:justify\">yang tersebar baik didalam maupun diluar negeri. Kami telah terakreditasi BAN-PT dan LAM-PT KES saat menjadi Akademi Keperawatan</p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\"><strong><span style=\"font-size:14px\">Sekolah Tinggi Ilmu Kesehatan??????? Husada memiliki lahan praktek mandiri yaitu RS.Husada, sebagai lahan praktek utama. Selain RS Husada mahasiswa kami menggunakan lahan praktek yaitu:</span></strong></p>\n\n<p style=\"margin-left:40px; text-align:justify\">1. RS. Husada Jakarta</p>\n\n<p style=\"margin-left:40px; text-align:justify\">2. RSUD Koja</p>\n\n<p style=\"margin-left:40px; text-align:justify\">3. RSJ. Dr. Hj. Marzoeki Mahdi</p>\n\n<p style=\"margin-left:40px; text-align:justify\">4. RSUK Kecamatan Sawah Besar</p>\n\n<p style=\"margin-left:40px; text-align:justify\">5. Puskesmas Menteng</p>\n\n<p style=\"margin-left:40px; text-align:justify\">6. Puskesmas Senen</p>\n\n<p style=\"margin-left:40px; text-align:justify\">7. Puskesmas Cempaka Putih</p>\n\n<p style=\"margin-left:40px; text-align:justify\">8. Wilayah Kecamatan Mangga Dua Selatan</p>\n\n<p style=\"margin-left:40px; text-align:justify\">9. Panti Werdha Santa Ana</p>\n\n<p style=\"margin-left:40px; text-align:justify\">10. Panti Werdha Wisma Mulia.</p>\n\n<p style=\"margin-left:40px; text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\">Kami menjamin kualitas lulusan kami untuk siap bekerja, dengan jumlah jam praktek klinik yang terstandar internasional. Mahasiswa dari D3 Keperawatan&nbsp;kami sudah mulai praktek mengaplikasikan teori keperawatan pada semester kedua. Lulusan kami sudah mulai direkrut oleh rumah sakit sejak semester VI.</p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\"><strong><span style=\"font-size:14px\">Sekolah Tinggi Ilmu Kesehatan</span></strong><strong><span style=\"font-size:14px\"> Husada memiliki Keunggulan yaitu:</span></strong></p>\n\n<p style=\"margin-left:40px; text-align:justify\">1. Peringkat empat besar se-DKI Jakarta Versi UKOMNAS</p>\n\n<p style=\"margin-left:40px; text-align:justify\">2. Kualitas Lulusan tidak kalah saing dengan lulusan sarjanan</p>\n\n<p style=\"margin-left:40px; text-align:justify\">3. Mempunyai lokasi yang strategis dan akses yang mudah</p>\n\n<p style=\"margin-left:40px; text-align:justify\">4. Memiliki Asrama Putri</p>\n\n<p style=\"margin-left:40px; text-align:justify\">5. Memiliki Gedung kampus dan lahan praktek sendiri</p>\n\n<p style=\"margin-left:40px; text-align:justify\">6. BEBAS Biaya lahan Praktek</p>\n\n<p style=\"margin-left:40px; text-align:justify\">7. 90% Mahasiswa telah direkruit oleh rumah sakit terkemukan/ berstandar Internasional pada semester V dan Vi</p>\n\n<p style=\"margin-left:40px; text-align:justify\">8. Memiliki Kurikulum muatan lokal: Emergency Nursing, bahasa Inggris, Komputer, Bahasa Mandarin (native teacher) dan bahasa jepang</p>\n\n<p style=\"margin-left:40px; text-align:justify\">9. Tersedia Beasiswa</p>\n\n<p style=\"margin-left:40px; text-align:justify\">&nbsp;</p>\n\n<p style=\"margin-left:40px; text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:center\"><iframe frameborder=\"0\" height=\"300px\" src=\"https://www.youtube.com/embed/YUO7nlEBqFc?rel=0\" width=\"90%\"></iframe></p>\n      ','ABOUT','2020-10-02 00:00:00');

