/*Data for the table `knowledge` */

insert  into `knowledge`(`id_knowledge`,`img`,`title`,`content`,`link`,`date`) values (6,'http://cms.stikesrshusada.ac.id/api/knowledge/1.jpg','EFEKTIFITAS MODEL PC-JeWa PERAWAT TERHADAP LOYALITAS PASIEN RAWAT INAP','Perilaku caring merupakan hal mutlak yang harus dilakukan perawat kepada pasien. Tujuan penelitian ini adalah untuk mengetahui efektifitas perilaku caring perawatan terhadap loyalitas pasien rawat inap rumah sakit. Penelitian ini menggunakan metode kualitatif pendekatan crosssectional dengan jumlah sampel sebanyak 100 orang yang diambil melalui random sampling. Hasil penelitian menunjukkan data bahwa perilaku caring perawat berhubungan secara signifikan terhadap kepuasan pasien (p value 0,000, OR=11,769). Kepuasan pasien juga berhubungan signifikan terhadap loyalitas pasien (p value 0,000, OR= 6,328). Perilaku caring berhubungan secara signifikan terhadap loyalitas pasien (p value 000, OR= 9,913). Dimensi perilaku caring perawat yang dominan adalah:membantu memenuhi kebutuhan pasien sesuai kemampuan dan ketidakmampuan pasien (misal: makan, minum, BAB, BAK, ganti pakaian dan lainnya) dengan nilai koefisien beta (OR=3,114). Perawat yang bekerja di pelayanan sebaiknya mengoptimalkan pemenuhan kebutuhan dasar untuk meningkatkan loyalitas pasien.','http://cms.stikesrshusada.ac.id/api/knowledge/1.pdf','2020-11-15 00:00:00'),(7,'http://cms.stikesrshusada.ac.id/api/knowledge/1.jpg','MENTAL, SOCIAL-PSYCHOLOGICAL STIMULATION AND NUTRITIONAL SUPLEMENTATION AFFECTING STUNTING INCIDENCE AMONG CHILDREN IN INDONESIA','Stunting is a public health problem regarding nutritional status that is diagnosed through a long body based on a standard deviation of minus two. One effort that can be done by families in overcoming the problem of stunting is through optimization of Mental Stimulation, Nutrition Supplementation and Social Psychological Stimulation (MeNu SoP). The purpose of this study was to determine the effectiveness of Mental Stimulation, Nutritional Supplementation and Social Psychological Stimulation on the incidence of stunting in children. The study design used quasi pre and post test experiments without control groups. The number of research samples as many as 40 respondents were selected using cluster sampling techniques. The results showed significant changes in the variable Mental Stimulation before and after the intervention (p value = 0,000), Nutritional Supplementation before and after the intervention (p value = 0,000), Social Psychological Stimulation (p value = 0,000), and anthropometric status before and After the intervention (p value = 0,000). The application of MeNu SoP can be used by families, nurses and other health workers to improve the status of anthropometric toddlers with stunting.','http://cms.stikesrshusada.ac.id/api/knowledge/1.pdf','2020-11-15 00:00:00'),(8,'http://cms.stikesrshusada.ac.id/api/knowledge/e-1.jpg','EnfermeriaclinicaIdentifying causal risk factors for stunting in childrenunder five years of age in South Jakarta, Indonesia','AbstractObjectives: To identify correlations between family characteristics, nutritional parenting, andstunting in children under five in South Jakarta.Method: This study used an observational, descriptive research design and a community-basedcross-sectional approach. A total of 192 samples were included in the study, selected using thecluster sampling technique. Family Characteristics and Nutritional Parenting Tools contain thetypes of questions that were used to collect the data. A correlation data analysis was conductedusing an independent t-test, chi-square, and multiple logistic regression prediction modeling.Results: The results of the research showed a significant correlation between family charac-teristics and nutritional parenting with the occurrence of stunting in children under five inSouth Jakarta. Families whose incomes were below the regional minimum wage had a 6.625times greater chance of observing stunting in children under five compared to families whoseincomes were above the regional minimum wage with Wald value of 28.148.Conclusions: Socioeconomic factors, especially household income, are the factors that are mostresponsible for influencing the incidence of stunting in children under five. Multisector andintegrated programs are needed to increase household income, knowledge, and family skills toreduce the incidence of stunting in children under five.','http://cms.stikesrshusada.ac.id/api/knowledge/e-1.pdf','2020-11-15 00:00:00'),(9,'http://cms.stikesrshusada.ac.id/api/knowledge/q-1.png','The Influence of Leadership Behavior, Organizational Culture,\r\nand Affective Commitment on Employee Performance','ABSTRACT. The increasingly intense competition in healthcare industry has also been experienced by the\r\nhospital organizations managers in Indonesia. Therefore, the management is required to continually reform the\r\nquality of their services, including by the improvement of employees performance, among others the nurse. This\r\nstudy aims to determine and analyze whether there are significant effects both directly and indirectly of the\r\nLeadership Behavior, Organizational Culture, and Affective Commitment to the Employee Performance. To\r\nobtain the primary data, a research instrument was developed in the form of a questionnaire containing several\r\nindicators of each variable studied. The study was conducted in a hospital organization where the employees\r\nstudied were restricted to the nurses at the respective hospital. The sampling technique was purposive sampling,\r\nwhile the data analysis technique used the path-analysis method. From the data analysis it was found that all\r\nhypotheses were accepted, meaning that the Leadership Behavior, Organizational Culture, and Affective\r\nCommitment partially had a significant effect on the Employee Performance.','http://cms.stikesrshusada.ac.id/api/knowledge/q-1.pdf','2020-11-15 00:00:00'),(10,'http://cms.stikesrshusada.ac.id/api/knowledge/q-1.png','Analysis on the Effect of Hard Skills, Intrapersonal and Interpersonal Skills toward the Performance of Nurses (A Case Study on the Alumni of Husada Hospital Nursing Academy, Jakarta, Indonesia)','ABSTRACT: The object of this study is to learn the role of hard skills and soft skills in improving the performance of nurses. The samples of the study are the alumni of Husada Hospital Nursing Academy, Jakarta. Multiple Linear Regression Technique is being used as the method to analyze the data. The study results indicated that the research variables which are hard skills, interpersonal and intrapersonal skills, both partially and simultaneously have a significant effect on the performance of nurses. Moreover, it is also found that the intrapersonal skills variable has the most dominant effect on the performance of nurses.','http://cms.stikesrshusada.ac.id/api/knowledge/q-2.pdf','2020-11-15 00:00:00'),(11,'URL OF IMAGE','TITLE OF KNOWLEDGE','CONTENT OF KNOWLEDGE','URL TO FILE FOR KNOWLEDGE','2020-11-18 00:00:00');

