/*Table structure for table `topic` */

DROP TABLE IF EXISTS `topic`;

CREATE TABLE `topic` (
  `id_topic` double NOT NULL AUTO_INCREMENT,
  `id_pm` double NOT NULL,
  `topic` varchar(50) DEFAULT NULL,
  `sub_topic` varchar(50) DEFAULT NULL,
  `capaian_pembelajaran` text DEFAULT NULL,
  `sesi` varchar(50) DEFAULT NULL,
  `status` int(10) unsigned DEFAULT 0,
  `reviewer_commen` text DEFAULT NULL,
  `reviewer_user` int(10) unsigned DEFAULT NULL,
  `reviewer_date` datetime DEFAULT NULL,
  `approv_commen` text DEFAULT NULL,
  `approv_user` int(10) unsigned DEFAULT NULL,
  `approv_date` datetime DEFAULT NULL,
  `create_user` int(10) unsigned DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `lastup_user` int(10) unsigned DEFAULT NULL,
  `lastup_date` datetime DEFAULT NULL,
  PRIMARY KEY (`id_topic`)
) ENGINE=InnoDB AUTO_INCREMENT=270 DEFAULT CHARSET=utf8;

